export const NoData = ({
  image,
  imageStyle,
  height = 60,
  title,
  description = "No Data Found",
  children,
}) => {
  return (
    <div className="w-full h-full vhcenter">
      {/* <Empty image={Empty.PRESENTED_IMAGE_SIMPLE} /> */}
      <Empty
        image={
          image ? (
            <img src={image} className="mx-auto" alt="no-data" />
          ) : (
            Empty.PRESENTED_IMAGE_SIMPLE
          )
        }
        imageStyle={{ height: { height }, ...imageStyle }}
        description={
          <div>
            <p className="text-xs font-semibold text-black 2xl:text-sm dark:text-white">
              {title}
            </p>
            <p className="text-[10px] 2xl:text-xs italic text-grey dark:text-darkText">
              {description}
            </p>
          </div>
        }
      >
        {children}
      </Empty>
    </div>
  );
};
